import Home from "./Components/Home";
import { Router, Route, Switch } from "react-router-dom";
import Classic from "./Components/Classic";

export default function App() {
  return (

      <Router>
          <Switch>
              <Route path="/classic">
                  <Classic />
              </Route>

              <Route path="/">
                  <Home />
              </Route>
          </Switch>
      </Router>
    
  );
  
};
